import React from 'react';
import MainTitle from "../../components/MainTitle/MainTitle";

import "./Explore.scss";
import ExploreCard from "../../components/ExploreCard/ExploreCard";

const Explore = () => {
    return (
        <div className="Explore container">
            <MainTitle
                title="Explore Destinations with Ease"
                text="Find the best deals on railway and airplane tickets in each city,
                carefully selected for you."
            />

            <ExploreCard
                title="Cheap Railway Tickets With Us"
                text="Embark on a railway adventure and explore destinations worldwide.
                Whether it's the picturesque landscapes, bustling cities, or cultural gems, our rail services offer a unique and comfortable way to traverse the globe. Immerse yourself in the beauty of different cultures, all accessible through our extensive railway network. ."
            />
        </div>
    )
}

export default Explore;
